import{_ as l,o as i,c as e,e as o}from"./app-c185cbc2.js";const t={},r=o("<ul><li><p>如何理解HTML语义化？</p><ul><li>让人更容易读（增加代码可读性）</li><li>让搜索引擎更容易读（SEO）</li></ul></li><li><p>默认哪些HTML标签是块级，哪些是内联？</p><ul><li>display:block/table; div h1 h2 table ul ol p等；不管内容多少都要独占一行</li><li>display:inline/inline-block; span img input button等；不会独占一行，直至浏览器的边缘</li></ul></li><li><p>什么是DOCTYPE,有何作用？</p><ul><li>Doctype是HTML5的文档声明，通过它可以告诉浏览器，使用哪一个HTML版本标准解析文档</li></ul></li><li><p>src和href的区别？</p><ul><li>src全称source，通常用于img、video、audio、script元素，通过src指向请求外部资源的来源地址，指向的内容会嵌入到文档中当前标签所在位置，在请求src资源时，它会将资源下载并应用到文档内，比如说：js脚本、img图片、frame等元素。当浏览器解析到该元素时，<strong>会暂停其它资源下载，直到将该资源加载、编译、执行完毕</strong>。这也是为什么将js脚本放在底部而不是头部的原因。</li><li>href：全称<em>hyper reference</em>，意味着超链接，<strong>指向网络资源</strong>，当浏览器识别到它指向的⽂件时，就会<strong>并⾏下载</strong>资源，<strong>不会停⽌对当前⽂档的处理</strong>，通常用于a、link元素。</li></ul></li><li><p>title和H1的区别、b与strong的区别、i与em的区别</p><ul><li><em>title</em> 属性表示网页的标题，<em>h1</em> 元素则表示层次明确的页面内容标题，对页面信息的抓取也有很大的影响</li><li><em>strong</em> 是标明重点内容，有语气加强的含义，使用阅读设备阅读网络时：strong会重读，而<em>b</em>是展示强调内容、</li><li><em>i</em> 是<em>italic</em>(斜体)的简写，是早期的斜体元素，表示内容展示为斜体，而 <em>em</em> 是<em>emphasize</em>（强调）的简写，表示强调的文本</li></ul></li><li><p>什么是严格模式与混杂模式？</p><ul><li>严格模式：是以浏览器支持的最高标准运行</li><li>混杂模式：页面以宽松向下兼容的方式显示，模拟老式浏览器的行为</li></ul></li><li><p>H5和HTML5的区别？</p><ul><li>H5是一个产品名词，包含了最新的HTML5、CSS3、ES6等新技术来制作的应用</li><li>HTML5是一个技术名词，指的就是第五代HTML</li></ul></li><li><p>对于web标准w3c的理解</p><ul><li><code>Web标准</code>简单来说可以分为结构、表现、行为。其中结构是由HTML各种标签组成，简单来说就是body里面写入标签是为了页面的结构。表现指的是CSS层叠样式表，通过CSS可以让我们的页面结构标签更具美感。行为指的是页面和用户具有一定的交互，这部分主要由JS组成</li><li><code>w3c</code>,全称：world wide web consortium是一个制定各种标准的非盈利性组织，也叫万维网联盟，标准包括HTML、CSS、ECMAScript等等，web标准的制定有很多好处，比如说： <ul><li>可以统一开发流程，统一使用标准化开发工具（VSCode、WebStorm、Sublime），方便多人协作</li><li>学习成本降低，只需要学习标准就行，否则就要学习各个浏览器厂商标准</li><li>跨平台，方便迁移都不同设备</li><li>降低代码维护成本</li></ul></li></ul></li><li><p>HTML5新增了哪些新特性？</p><ul><li>HTML5主要是关于图像、位置、存储、多任务等功能的增加： <ul><li>语义化标签，如：article、footer、header、nav等</li><li>视频video、音频audio</li><li>画布canvas</li><li>表单控件，calemdar、date、time、email</li><li>地理</li><li>本地离线存储，localStorage长期存储数据，浏览器关闭后数据不丢失，sessionStorage的数据在浏览器关闭后自动删除</li><li>拖拽释放</li></ul></li></ul></li><li><p>你知道SEO中的TDK吗？</p><ul><li>在SEO中，TDK其实就是<code>title</code>、<code>description</code>、<code>keywords</code>这三个标签，title表示标题标签，description是描述标签，keywords是关键词标签</li></ul></li></ul>",1),c=[r];function s(m,n){return i(),e("div",null,c)}const p=l(t,[["render",s],["__file","html.html.vue"]]);export{p as default};
